INSERT INTO `aboutus` (`id`, `title`, `about`, `att`, `todaydate`) VALUES
(2, 'About Us', '	                		 	                		 <p><b>BRAVODENT PRIVATE LIMITED</b><em style=\"font-weight: bold; font-style: normal; color: rgb(95, 99, 104); font-family: arial, sans-serif; font-size: 14px; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: 0.5px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"></em><span style=\"color: rgb(77, 81, 86); font-family: arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: 0.5px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\"><span> </span>is constantly expanding its product range to introduce innovative products every year, manufactured at state-of-the-art manufacturing facilities, which are GMP and Halal certified.<span> </span></span><b>BRAVODENT PRIVATE LIMITED</b><span style=\"color: rgb(77, 81, 86); font-family: arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: 0.5px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">&nbsp; is an ISO 9001-2015 certified company and believes in world class service levels to all its customers.</span></p><p><b>BRAVODENT PRIVATE LIMITED</b><span style=\"color: rgb(68, 68, 68); font-family: FuturaStd, sans-serif; text-align: center; font-size: 1rem;\">, which started its operations in the year 2021, is now becoming a leading direct selling company dealing in world-class wellness products. Vestige is constantly growing at a phenomenal rate every year. The growth rate in itself speaks volumes about the quality of the products, the marketing plan and the management that have been able to deliver such a rewarding and sustainable system.</span></p>', 'images/1636357603-4441-aboutus4.png', '17-Nov-2022');
